import React from 'react'
import './Chat.css'
import {Avatar} from "@mui/material";
function Chat(){
    return(
    <div className="chat">
        <h1>This is Chat Section</h1>
        <div className="Header">
            <Avatar/>
            <div className="class"></div>
        </div>
    </div>
    );
}

export default Chat
